import React from 'react';

export default function Home () {
    return (
        <div style={{
            backgroundColor: 'lavender',
            display: 'grid',
            borderStyle: 'solid',
            borderColor: 'red',
            gridTemplateColumns: 'repeat(3, 1fr)',
            gridTemplateRows: 'repeat(3, 1fr)',
            gridGap: '10px'
              }
        }>
            <h1>TAYLER RADCLIFFE</h1>
        </div>
    )
}
